const data = {
   productData: [
      {
         "name": "Hamburger",
         "price": "200",
         "image": "/images/burger.jpeg"
      },
      {
         "name": "Fries",
         "price": "100",
         "image": "/images/fries.jpeg"
      },

      {
         id: 3,
         "name": "Coke",
         "price": "50",
         "image": "/image/coke.jpeg"
      },

      {
         id: 4,
         "name": "Pepsi",
         "price": "50",
         "image": "image/pepsi.jpeg"

      },


   ],
}
export default data;
